INSERT INTO `gigsong` VALUES (NULL,'1988-04-15 00:00:00','set',NULL,1,0,'The Entire Performance',NULL,' \n		<p> \n		This is the 217th upload of my concerts collection recorded in Lyon (France) between 1982-1990. \n		The JAZZ BUTCHER were recorded for ZAP FM at the Rail Th&eacute;atre in Lyon in spring 1988. \n		The complete show was recorded on-the-fly with my usual way of mixing sdb outputs with 4 ambiance mikes to a HiFi video tape \n		recorder. \n		</p> \n		<p> \n		For this night, I\'ve placed 2 ambience mikes (Sennheiser MD441) on each side of the stage and another couple (Sennheiser \n		cardoids) close to the soundboard. \n		That night, I\'ve a 16 tracks soundboard for recording... \n		</p> \n		<p> \n		I took usual sdb outputs on 2 tracks and some individual instruments outputs (from band sdb)... \n		bass drum/snare/bass guitar/2 guitars/vocals completing the last 4 tracks with my 4 microphones. \n		By this way, you have more than a pure sdb, and, very important, on the recording you have the effects (reverb/delay/etc...) \n		used by the soundman. \n		This is the main difference with the incomplete recording done on a multitracks recorder and mixed in studio afterwards (LTC \n		216). \n		</p> \n		<p> \n		So this new recording sounds as it was naturally in the venue... and the songs are in the right order... yep!! \n		Bad souvenir!!! \n		</p> \n		<p> \n		At the end of the show, I saw a guy steal one of my big Sennheiser on the right side of the stage... \n		I was at the other side of the venue... impossible to catch him. \n		I\'ve recorded a ton of concerts in Lyon, it was the only time I\'ve lost something...  \n		</p>',NULL,'https://s3.amazonaws.com/assets.jazzbutcher.com/audio/gigs/19880415/19880415_JazzButcher_LyonFrance_RailTheatre_FLAC.mp3','Lolive',NULL,NULL);
