INSERT INTO `gigsong` VALUES (NULL,'2018-05-27 19:30:00','set',NULL,1,0,'The Entire Performance',NULL,'\n2018-05-27 - The Jazz Butcher, 100 Club, London. (+ 1 extra track) \n \nVery sad to hear that Pat Fish passed away suddenly. A great talent, passionate about music and a cracking sense of humour. Paying my own tribute by sharing a live gig I recorded when both he and the band I was playing in (Jowe Head\'s Infernal Contraption) supported The Bevis Frond. Track 8 is taken from when he guested with Television Personalities at a benefit gig for Dan Treacy later that year at the same venue - which for me was the highlight of the night. RIP Pat. \n \nLineage - Tascam DR-07 16 bit WAV - Audacity - Tascam DR-07 track splitting - FLAC\n',NULL,'https://s3.amazonaws.com/assets.jazzbutcher.com/audio/gigs/20180527/20180527_JazzButcher_London_100Club_FLAC.mp3',NULL,NULL,NULL);
