INSERT INTO `gigsong` VALUES (NULL,'2019-10-05 00:00:00','set',NULL,1,1,'The Interview',NULL,'The late Pat Fish in conversation with me on 5th October 2019.  Much of this would become the \'Fishcotheque\' chapter of \'Miracles and Wonders\', the book Pat and I wrote, which I finished and published after he shuffled off on 5th October 2021.\nIt was a lovely, if emotional day.  We ate bagels and smoked cheese at my house, watched the Tottenham game (they lost 3-0 to Brighton), aborted an intended trip to Uppingham, before arriving at the Plough, Shutlanger.  After the recording we went on a little pub crawl, witnessed a skein of geese fly noisily overhead (\"I don\'t think I\'ve ever seen that before\", said Pat), and consumed a takeaway back at Fishy Mansions.',NULL,'https://www.youtube.com//embed/zYpruNL9Rr0','Philip Snow','https://www.youtube.com/@philipsnow6393',NULL);
